import numpy as np


DOF = 6

class BFSPlate2D(object):
    __slots__ = ['n1', 'n2', 'n3', 'n4', 'ABD', 'lex', 'ley', 'rho']
    def __init__(self):
        self.n1 = None
        self.n2 = None
        self.n3 = None
        self.n4 = None
        # Material Lastrobe Lescalloy
        self.ABD = None
        self.rho = None
        self.lex = None
        self.ley = None

    def Bm(self, xi, eta):
        lex = self.lex
        ley = self.ley
        return np.array(
         [[2*(eta/4 - 1/4)/lex, 0, 0, 0, 0, 0, 2*(1/4 - eta/4)/lex, 0, 0, 0, 0, 0, 2*(eta/4 + 1/4)/lex, 0, 0, 0, 0, 0, 2*(-eta/4 - 1/4)/lex, 0, 0, 0, 0, 0],
          [0, 2*(xi/4 - 1/4)/ley, 0, 0, 0, 0, 0, 2*(-xi/4 - 1/4)/ley, 0, 0, 0, 0, 0, 2*(xi/4 + 1/4)/ley, 0, 0, 0, 0, 0, 2*(1/4 - xi/4)/ley, 0, 0, 0, 0],
          [2*(xi/4 - 1/4)/ley, 2*(eta/4 - 1/4)/lex, 0, 0, 0, 0, 2*(-xi/4 - 1/4)/ley, 2*(1/4 - eta/4)/lex, 0, 0, 0, 0, 2*(xi/4 + 1/4)/ley, 2*(eta/4 + 1/4)/lex, 0, 0, 0, 0, 2*(1/4 - xi/4)/ley, 2*(-eta/4 - 1/4)/lex, 0, 0, 0, 0]]
         )

    def Bb(self, xi, eta):
        lex = self.lex
        ley = self.ley
        return np.array(
         [[0, 0, -4*((-eta - 2)*(eta - 1)**2*(-xi - 2)/8 - (-eta - 2)*(eta - 1)**2*(2*xi - 2)/8)/lex**2, -4*(lex*(-eta - 2)*(eta - 1)**2*(-xi - 1)/16 - lex*(-eta - 2)*(eta - 1)**2*(2*xi - 2)/16)/lex**2, -4*(ley*(-eta - 1)*(eta - 1)**2*(-xi - 2)/16 - ley*(-eta - 1)*(eta - 1)**2*(2*xi - 2)/16)/lex**2, -4*(lex*ley*(-eta - 1)*(eta - 1)**2*(-xi - 1)/32 - lex*ley*(-eta - 1)*(eta - 1)**2*(2*xi - 2)/32)/lex**2, 0, 0, -4*(2*(-eta - 2)*(eta - 1)**2*(xi/8 + 1/8) + (-eta - 2)*(eta - 1)**2*(xi - 2)/8)/lex**2, -4*(-lex*(-eta - 2)*(eta - 1)**2*(xi - 1)/16 - lex*(-eta - 2)*(eta - 1)**2*(2*xi + 2)/16)/lex**2, -4*(ley*(-eta - 1)*(eta - 1)**2*(xi - 2)/16 + ley*(-eta - 1)*(eta - 1)**2*(2*xi + 2)/16)/lex**2, -4*(-lex*ley*(-eta - 1)*(eta - 1)**2*(xi - 1)/32 - lex*ley*(-eta - 1)*(eta - 1)**2*(2*xi + 2)/32)/lex**2, 0, 0, -4*((eta - 2)*(eta + 1)**2*(xi - 2)/8 + (eta - 2)*(eta + 1)**2*(2*xi + 2)/8)/lex**2, -4*(-lex*(eta - 2)*(eta + 1)**2*(xi - 1)/16 - lex*(eta - 2)*(eta + 1)**2*(2*xi + 2)/16)/lex**2, -4*(-ley*(eta - 1)*(eta + 1)**2*(xi - 2)/16 - ley*(eta - 1)*(eta + 1)**2*(2*xi + 2)/16)/lex**2, -4*(lex*ley*(eta - 1)*(eta + 1)**2*(xi - 1)/32 + lex*ley*(eta - 1)*(eta + 1)**2*(2*xi + 2)/32)/lex**2, 0, 0, -4*((eta - 2)*(eta + 1)**2*(-xi - 2)/8 - (eta - 2)*(eta + 1)**2*(2*xi - 2)/8)/lex**2, -4*(lex*(eta - 2)*(eta + 1)**2*(-xi - 1)/16 - lex*(eta - 2)*(eta + 1)**2*(2*xi - 2)/16)/lex**2, -4*(-ley*(eta - 1)*(eta + 1)**2*(-xi - 2)/16 + ley*(eta - 1)*(eta + 1)**2*(2*xi - 2)/16)/lex**2, -4*(-lex*ley*(eta - 1)*(eta + 1)**2*(-xi - 1)/32 + lex*ley*(eta - 1)*(eta + 1)**2*(2*xi - 2)/32)/lex**2],
          [0, 0, -4*((1/8 - eta/8)*(-xi - 2)*(xi - 1)**2 + (-eta - 2)*(-xi - 2)*(xi - 1)**2/8 - (eta/8 - 1/8)*(-xi - 2)*(xi - 1)**2)/ley**2, -4*(lex*(-eta - 2)*(-xi - 1)*(xi - 1)**2/16 - lex*(2*eta - 2)*(-xi - 1)*(xi - 1)**2/16)/ley**2, -4*(ley*(-eta - 1)*(-xi - 2)*(xi - 1)**2/16 - ley*(2*eta - 2)*(-xi - 2)*(xi - 1)**2/16)/ley**2, -4*(lex*ley*(-eta - 1)*(-xi - 1)*(xi - 1)**2/32 - lex*ley*(2*eta - 2)*(-xi - 1)*(xi - 1)**2/32)/ley**2, 0, 0, -4*((-eta - 2)*(xi - 2)*(xi + 1)**2/8 - (2*eta - 2)*(xi - 2)*(xi + 1)**2/8)/ley**2, -4*(-lex*(-eta - 2)*(xi - 1)*(xi + 1)**2/16 + lex*(2*eta - 2)*(xi - 1)*(xi + 1)**2/16)/ley**2, -4*(ley*(-eta - 1)*(xi - 2)*(xi + 1)**2/16 - ley*(2*eta - 2)*(xi - 2)*(xi + 1)**2/16)/ley**2, -4*(-lex*ley*(-eta - 1)*(xi - 1)*(xi + 1)**2/32 + lex*ley*(2*eta - 2)*(xi - 1)*(xi + 1)**2/32)/ley**2, 0, 0, -4*(2*(eta/8 + 1/8)*(xi - 2)*(xi + 1)**2 + (eta - 2)*(xi - 2)*(xi + 1)**2/8)/ley**2, -4*(-lex*(eta - 2)*(xi - 1)*(xi + 1)**2/16 - lex*(2*eta + 2)*(xi - 1)*(xi + 1)**2/16)/ley**2, -4*(-ley*(eta - 1)*(xi - 2)*(xi + 1)**2/16 - ley*(2*eta + 2)*(xi - 2)*(xi + 1)**2/16)/ley**2, -4*(lex*ley*(eta - 1)*(xi - 1)*(xi + 1)**2/32 + lex*ley*(2*eta + 2)*(xi - 1)*(xi + 1)**2/32)/ley**2, 0, 0, -4*(2*(eta/8 + 1/8)*(-xi - 2)*(xi - 1)**2 + (eta - 2)*(-xi - 2)*(xi - 1)**2/8)/ley**2, -4*(lex*(eta - 2)*(-xi - 1)*(xi - 1)**2/16 + lex*(2*eta + 2)*(-xi - 1)*(xi - 1)**2/16)/ley**2, -4*(-ley*(eta - 1)*(-xi - 2)*(xi - 1)**2/16 - ley*(2*eta + 2)*(-xi - 2)*(xi - 1)**2/16)/ley**2, -4*(-lex*ley*(eta - 1)*(-xi - 1)*(xi - 1)**2/32 - lex*ley*(2*eta + 2)*(-xi - 1)*(xi - 1)**2/32)/ley**2],
          [0, 0, -4*((1/8 - eta/8)*(-eta - 2)*(xi - 1)**2 + (-eta - 2)*(eta/8 - 1/8)*(-xi - 2)*(2*xi - 2) - (eta - 1)**2*(-xi - 2)*(2*xi - 2)/16 + (eta - 1)**2*(xi - 1)**2/16)/(lex*ley) - 4*((-eta - 2)*(eta/8 - 1/8)*(-xi - 2)*(2*xi - 2) - (-eta - 2)*(eta/8 - 1/8)*(xi - 1)**2 - (eta - 1)**2*(-xi - 2)*(2*xi - 2)/16 + (eta - 1)**2*(xi - 1)**2/16)/(lex*ley), -8*(lex*(-eta - 2)*(2*eta - 2)*(-xi - 1)*(2*xi - 2)/32 - lex*(-eta - 2)*(2*eta - 2)*(xi - 1)**2/32 - lex*(eta - 1)**2*(-xi - 1)*(2*xi - 2)/32 + lex*(eta - 1)**2*(xi - 1)**2/32)/(lex*ley), -8*(ley*(-eta - 1)*(2*eta - 2)*(-xi - 2)*(2*xi - 2)/32 - ley*(-eta - 1)*(2*eta - 2)*(xi - 1)**2/32 - ley*(eta - 1)**2*(-xi - 2)*(2*xi - 2)/32 + ley*(eta - 1)**2*(xi - 1)**2/32)/(lex*ley), -8*(lex*ley*(-eta - 1)*(2*eta - 2)*(-xi - 1)*(2*xi - 2)/64 - lex*ley*(-eta - 1)*(2*eta - 2)*(xi - 1)**2/64 - lex*ley*(eta - 1)**2*(-xi - 1)*(2*xi - 2)/64 + lex*ley*(eta - 1)**2*(xi - 1)**2/64)/(lex*ley), 0, 0, -4*((-eta - 2)*(2*eta - 2)*(xi/8 + 1/8)*(xi - 2) + (-eta - 2)*(2*eta - 2)*(xi + 1)**2/16 + (eta - 1)**2*(-xi/8 - 1/8)*(xi - 2) - (eta - 1)**2*(xi + 1)**2/16)/(lex*ley) - 4*((-eta - 2)*(2*eta - 2)*(xi/8 + 1/8)*(xi - 2) + (-eta - 2)*(2*eta - 2)*(xi + 1)**2/16 - (eta - 1)**2*(xi/8 + 1/8)*(xi - 2) - (eta - 1)**2*(xi + 1)**2/16)/(lex*ley), -8*(-lex*(-eta - 2)*(2*eta - 2)*(xi - 1)*(2*xi + 2)/32 - lex*(-eta - 2)*(2*eta - 2)*(xi + 1)**2/32 + lex*(eta - 1)**2*(xi - 1)*(2*xi + 2)/32 + lex*(eta - 1)**2*(xi + 1)**2/32)/(lex*ley), -8*(ley*(-eta - 1)*(2*eta - 2)*(xi - 2)*(2*xi + 2)/32 + ley*(-eta - 1)*(2*eta - 2)*(xi + 1)**2/32 - ley*(eta - 1)**2*(xi - 2)*(2*xi + 2)/32 - ley*(eta - 1)**2*(xi + 1)**2/32)/(lex*ley), -8*(-lex*ley*(-eta - 1)*(2*eta - 2)*(xi - 1)*(2*xi + 2)/64 - lex*ley*(-eta - 1)*(2*eta - 2)*(xi + 1)**2/64 + lex*ley*(eta - 1)**2*(xi - 1)*(2*xi + 2)/64 + lex*ley*(eta - 1)**2*(xi + 1)**2/64)/(lex*ley), 0, 0, -8*((eta/8 + 1/8)*(eta - 2)*(xi - 2)*(2*xi + 2) + (eta/8 + 1/8)*(eta - 2)*(xi + 1)**2 + (eta + 1)**2*(xi - 2)*(2*xi + 2)/16 + (eta + 1)**2*(xi + 1)**2/16)/(lex*ley), -8*(-lex*(eta - 2)*(2*eta + 2)*(xi - 1)*(2*xi + 2)/32 - lex*(eta - 2)*(2*eta + 2)*(xi + 1)**2/32 - lex*(eta + 1)**2*(xi - 1)*(2*xi + 2)/32 - lex*(eta + 1)**2*(xi + 1)**2/32)/(lex*ley), -8*(-ley*(eta - 1)*(2*eta + 2)*(xi - 2)*(2*xi + 2)/32 - ley*(eta - 1)*(2*eta + 2)*(xi + 1)**2/32 - ley*(eta + 1)**2*(xi - 2)*(2*xi + 2)/32 - ley*(eta + 1)**2*(xi + 1)**2/32)/(lex*ley), -8*(lex*ley*(eta - 1)*(2*eta + 2)*(xi - 1)*(2*xi + 2)/64 + lex*ley*(eta - 1)*(2*eta + 2)*(xi + 1)**2/64 + lex*ley*(eta + 1)**2*(xi - 1)*(2*xi + 2)/64 + lex*ley*(eta + 1)**2*(xi + 1)**2/64)/(lex*ley), 0, 0, -4*((-eta/8 - 1/8)*(eta - 2)*(xi - 1)**2 + (eta/8 + 1/8)*(eta - 2)*(-xi - 2)*(2*xi - 2) + (eta + 1)**2*(-xi - 2)*(2*xi - 2)/16 - (eta + 1)**2*(xi - 1)**2/16)/(lex*ley) - 4*((eta/8 + 1/8)*(eta - 2)*(-xi - 2)*(2*xi - 2) - (eta/8 + 1/8)*(eta - 2)*(xi - 1)**2 + (eta + 1)**2*(-xi - 2)*(2*xi - 2)/16 - (eta + 1)**2*(xi - 1)**2/16)/(lex*ley), -8*(lex*(eta - 2)*(2*eta + 2)*(-xi - 1)*(2*xi - 2)/32 - lex*(eta - 2)*(2*eta + 2)*(xi - 1)**2/32 + lex*(eta + 1)**2*(-xi - 1)*(2*xi - 2)/32 - lex*(eta + 1)**2*(xi - 1)**2/32)/(lex*ley), -8*(-ley*(eta - 1)*(2*eta + 2)*(-xi - 2)*(2*xi - 2)/32 + ley*(eta - 1)*(2*eta + 2)*(xi - 1)**2/32 - ley*(eta + 1)**2*(-xi - 2)*(2*xi - 2)/32 + ley*(eta + 1)**2*(xi - 1)**2/32)/(lex*ley), -8*(-lex*ley*(eta - 1)*(2*eta + 2)*(-xi - 1)*(2*xi - 2)/64 + lex*ley*(eta - 1)*(2*eta + 2)*(xi - 1)**2/64 - lex*ley*(eta + 1)**2*(-xi - 1)*(2*xi - 2)/64 + lex*ley*(eta + 1)**2*(xi - 1)**2/64)/(lex*ley)]]
         )


def update_K(plate, nid_pos, ncoords, K):
    """Update a global stiffness matrix K

    Properties
    ----------
    plate : `.BFSPlate2D` object
        The plate element being added to K
    nid_pos : dict
        Correspondence between node ids and their position in the global assembly
    ncoords : list
        Nodal coordinates of the whole model
    K : np.array
        Global stiffness matrix updated in-place
    """
    pos1 = nid_pos[plate.n1]
    pos2 = nid_pos[plate.n2]
    pos3 = nid_pos[plate.n3]
    pos4 = nid_pos[plate.n4]
    x1, y1 = ncoords[pos1]
    x2, y2 = ncoords[pos2]
    x3, y3 = ncoords[pos3]
    x4, y4 = ncoords[pos4]
    lex = abs(x2 - x1)
    ley = abs(y3 - y2)
    plate.lex = lex
    plate.ley = ley
    A11 = plate.ABD[0, 0]
    A12 = plate.ABD[0, 1]
    A16 = plate.ABD[0, 2]
    A22 = plate.ABD[1, 1]
    A26 = plate.ABD[1, 2]
    A66 = plate.ABD[2, 2]
    B11 = plate.ABD[0, 0+3]
    B12 = plate.ABD[0, 1+3]
    B16 = plate.ABD[0, 2+3]
    B22 = plate.ABD[1, 1+3]
    B26 = plate.ABD[1, 2+3]
    B66 = plate.ABD[2, 2+3]
    D11 = plate.ABD[0+3, 0+3]
    D12 = plate.ABD[0+3, 1+3]
    D16 = plate.ABD[0+3, 2+3]
    D22 = plate.ABD[1+3, 1+3]
    D26 = plate.ABD[1+3, 2+3]
    D66 = plate.ABD[2+3, 2+3]

    # positions the global matrices
    c1 = DOF*pos1
    c2 = DOF*pos2
    c3 = DOF*pos3
    c4 = DOF*pos4

    #TODO sparse matrix and use only upper/lower triangle
    K[0+c1, 0+c1] += A11*ley/(3*lex) + A16/2 + A66*lex/(3*ley)
    K[0+c1, 1+c1] += A12/4 + A16*ley/(3*lex) + A26*lex/(3*ley) + A66/4
    K[0+c1, 2+c1] += -B12/(2*ley) + B16/(2*lex) + B66/ley
    K[0+c1, 3+c1] += -7*B11*ley/(20*lex) - B12*lex/(12*ley) - B16/2 - B66*lex/(6*ley)
    K[0+c1, 4+c1] += -B12/2 - B16*ley/(4*lex) - 7*B26*lex/(20*ley)
    K[0+c1, 5+c1] += -B11*ley**2/(20*lex) - B12*lex/12 - B16*ley/12 - B26*lex**2/(20*ley)
    K[0+c1, 0+c2] += -A11*ley/(3*lex) + A66*lex/(6*ley)
    K[0+c1, 1+c2] += A12/4 - A16*ley/(3*lex) + A26*lex/(6*ley) - A66/4
    K[0+c1, 2+c2] += -B12/(2*ley) - B16/(2*lex) - B66/ley
    K[0+c1, 3+c2] += 7*B11*ley/(20*lex) + B12*lex/(12*ley) + B66*lex/(6*ley)
    K[0+c1, 4+c2] += -B12/2 + B16*ley/(4*lex) - 3*B26*lex/(20*ley)
    K[0+c1, 5+c2] += B11*ley**2/(20*lex) + B12*lex/12 + B26*lex**2/(30*ley)
    K[0+c1, 0+c3] += -A11*ley/(6*lex) - A16/2 - A66*lex/(6*ley)
    K[0+c1, 1+c3] += -A12/4 - A16*ley/(6*lex) - A26*lex/(6*ley) - A66/4
    K[0+c1, 2+c3] += B12/(2*ley) + 3*B16/(2*lex) + B66/ley
    K[0+c1, 3+c3] += 3*B11*ley/(20*lex) - B12*lex/(12*ley) - B66*lex/(6*ley)
    K[0+c1, 4+c3] += -B16*ley/(4*lex) + 3*B26*lex/(20*ley)
    K[0+c1, 5+c3] += -(B11*ley**3 + B26*lex**3)/(30*lex*ley)
    K[0+c1, 0+c4] += A11*ley/(6*lex) - A66*lex/(3*ley)
    K[0+c1, 1+c4] += -A12/4 + A16*ley/(6*lex) - A26*lex/(3*ley) + A66/4
    K[0+c1, 2+c4] += B12/(2*ley) - 3*B16/(2*lex) - B66/ley
    K[0+c1, 3+c4] += -3*B11*ley/(20*lex) + B12*lex/(12*ley) - B16/2 + B66*lex/(6*ley)
    K[0+c1, 4+c4] += B16*ley/(4*lex) + 7*B26*lex/(20*ley)
    K[0+c1, 5+c4] += B11*ley**2/(30*lex) + B16*ley/12 + B26*lex**2/(20*ley)
    K[1+c1, 0+c1] += A12/4 + A16*ley/(3*lex) + A26*lex/(3*ley) + A66/4
    K[1+c1, 1+c1] += A22*lex/(3*ley) + A26/2 + A66*ley/(3*lex)
    K[1+c1, 2+c1] += -B12/(2*lex) + B26/(2*ley) + B66/lex
    K[1+c1, 3+c1] += -B12/2 - 7*B16*ley/(20*lex) - B26*lex/(4*ley)
    K[1+c1, 4+c1] += -B12*ley/(12*lex) - 7*B22*lex/(20*ley) - B26/2 - B66*ley/(6*lex)
    K[1+c1, 5+c1] += -B12*ley/12 - B16*ley**2/(20*lex) - B22*lex**2/(20*ley) - B26*lex/12
    K[1+c1, 0+c2] += -A12/4 - A16*ley/(3*lex) + A26*lex/(6*ley) + A66/4
    K[1+c1, 1+c2] += A22*lex/(6*ley) - A66*ley/(3*lex)
    K[1+c1, 2+c2] += B12/(2*lex) - 3*B26/(2*ley) - B66/lex
    K[1+c1, 3+c2] += 7*B16*ley/(20*lex) + B26*lex/(4*ley)
    K[1+c1, 4+c2] += B12*ley/(12*lex) - 3*B22*lex/(20*ley) - B26/2 + B66*ley/(6*lex)
    K[1+c1, 5+c2] += B16*ley**2/(20*lex) + B22*lex**2/(30*ley) + B26*lex/12
    K[1+c1, 0+c3] += -A12/4 - A16*ley/(6*lex) - A26*lex/(6*ley) - A66/4
    K[1+c1, 1+c3] += -A22*lex/(6*ley) - A26/2 - A66*ley/(6*lex)
    K[1+c1, 2+c3] += B12/(2*lex) + 3*B26/(2*ley) + B66/lex
    K[1+c1, 3+c3] += 3*B16*ley/(20*lex) - B26*lex/(4*ley)
    K[1+c1, 4+c3] += -B12*ley/(12*lex) + 3*B22*lex/(20*ley) - B66*ley/(6*lex)
    K[1+c1, 5+c3] += -(B16*ley**3 + B22*lex**3)/(30*lex*ley)
    K[1+c1, 0+c4] += A12/4 + A16*ley/(6*lex) - A26*lex/(3*ley) - A66/4
    K[1+c1, 1+c4] += -A22*lex/(3*ley) + A66*ley/(6*lex)
    K[1+c1, 2+c4] += -B12/(2*lex) - B26/(2*ley) - B66/lex
    K[1+c1, 3+c4] += -B12/2 - 3*B16*ley/(20*lex) + B26*lex/(4*ley)
    K[1+c1, 4+c4] += B12*ley/(12*lex) + 7*B22*lex/(20*ley) + B66*ley/(6*lex)
    K[1+c1, 5+c4] += B12*ley/12 + B16*ley**2/(30*lex) + B22*lex**2/(20*ley)
    K[2+c1, 0+c1] += -B12/(2*ley) + B16/(2*lex) + B66/ley
    K[2+c1, 1+c1] += -B12/(2*lex) + B26/(2*ley) + B66/lex
    K[2+c1, 2+c1] += 156*D11*ley/(35*lex**3) + 72*D12/(25*lex*ley) + 156*D22*lex/(35*ley**3) + 144*D66/(25*lex*ley)
    K[2+c1, 3+c1] += 78*D11*ley/(35*lex**2) + 36*D12/(25*ley) + 22*D22*lex**2/(35*ley**3) + 12*D66/(25*ley)
    K[2+c1, 4+c1] += 22*D11*ley**2/(35*lex**3) + 36*D12/(25*lex) + 78*D22*lex/(35*ley**2) + 12*D66/(25*lex)
    K[2+c1, 5+c1] += 11*D11*ley**2/(35*lex**2) + 11*D12/50 - 2*D16*ley/(5*lex) + 11*D22*lex**2/(35*ley**2) - 2*D26*lex/(5*ley) + D66/25
    K[2+c1, 0+c2] += B12/(2*ley) - B16/(2*lex) + B66/ley
    K[2+c1, 1+c2] += B12/(2*lex) + 3*B26/(2*ley) - B66/lex
    K[2+c1, 2+c2] += -156*D11*ley/(35*lex**3) - 72*D12/(25*lex*ley) + 54*D22*lex/(35*ley**3) - 144*D66/(25*lex*ley)
    K[2+c1, 3+c2] += 78*D11*ley/(35*lex**2) + 6*D12/(25*ley) - 13*D22*lex**2/(35*ley**3) + 12*D66/(25*ley)
    K[2+c1, 4+c2] += -22*D11*ley**2/(35*lex**3) - 36*D12/(25*lex) + 27*D22*lex/(35*ley**2) - 2*D26/ley - 12*D66/(25*lex)
    K[2+c1, 5+c2] += 11*D11*ley**2/(35*lex**2) + 3*D12/25 + 2*D16*ley/(5*lex) - 13*D22*lex**2/(70*ley**2) + 2*D26*lex/(5*ley) + D66/25
    K[2+c1, 0+c3] += -B12/(2*ley) - 3*B16/(2*lex) - B66/ley
    K[2+c1, 1+c3] += -B12/(2*lex) - 3*B26/(2*ley) - B66/lex
    K[2+c1, 2+c3] += -54*D11*ley/(35*lex**3) + 72*D12/(25*lex*ley) - 54*D22*lex/(35*ley**3) + 144*D66/(25*lex*ley)
    K[2+c1, 3+c3] += 27*D11*ley/(35*lex**2) - 6*D12/(25*ley) + 2*D16/lex + 13*D22*lex**2/(35*ley**3) - 12*D66/(25*ley)
    K[2+c1, 4+c3] += 13*D11*ley**2/(35*lex**3) - 6*D12/(25*lex) + 27*D22*lex/(35*ley**2) + 2*D26/ley - 12*D66/(25*lex)
    K[2+c1, 5+c3] += -13*D11*ley**2/(70*lex**2) + D12/50 - 2*D16*ley/(5*lex) - 13*D22*lex**2/(70*ley**2) - 2*D26*lex/(5*ley) + D66/25
    K[2+c1, 0+c4] += B12/(2*ley) + 3*B16/(2*lex) - B66/ley
    K[2+c1, 1+c4] += B12/(2*lex) - B26/(2*ley) + B66/lex
    K[2+c1, 2+c4] += 54*D11*ley/(35*lex**3) - 72*D12/(25*lex*ley) - 156*D22*lex/(35*ley**3) - 144*D66/(25*lex*ley)
    K[2+c1, 3+c4] += 27*D11*ley/(35*lex**2) - 36*D12/(25*ley) - 2*D16/lex - 22*D22*lex**2/(35*ley**3) - 12*D66/(25*ley)
    K[2+c1, 4+c4] += -13*D11*ley**2/(35*lex**3) + 6*D12/(25*lex) + 78*D22*lex/(35*ley**2) + 12*D66/(25*lex)
    K[2+c1, 5+c4] += -13*D11*ley**2/(70*lex**2) + 3*D12/25 + 2*D16*ley/(5*lex) + 11*D22*lex**2/(35*ley**2) + 2*D26*lex/(5*ley) + D66/25
    K[3+c1, 0+c1] += -7*B11*ley/(20*lex) - B12*lex/(12*ley) - B16/2 - B66*lex/(6*ley)
    K[3+c1, 1+c1] += -B12/2 - 7*B16*ley/(20*lex) - B26*lex/(4*ley)
