def update_Kg(u, plate, nid_pos, points, weights, Kg):
    """Update a global geometric stiffness matrix Kg

    Properties
    ----------
    u : np.array
        Global displacement vector
    plate : `.BFSPlate2D` object
        The plate element being added to Kg
    nid_pos : dict
        Correspondence between node ids and their position in the global assembly
    points : np.array
        Integration poins
    weights : np.array
        Integration weights
    Kg : np.array
        Global geometric stiffness matrix updated in-place

    """
    pos1 = nid_pos[plate.n1]
    pos2 = nid_pos[plate.n2]
    pos3 = nid_pos[plate.n3]
    pos4 = nid_pos[plate.n4]
    #NOTE assuming that lex and ley are already known
    lex = plate.lex
    ley = plate.ley
    A = plate.ABD[0:3, 0:3]
    B = plate.ABD[0:3, 3:6]
    D = plate.ABD[3:6, 3:6]

    # positions the global matrices
    c1 = DOF*pos1
    c2 = DOF*pos2
    c3 = DOF*pos3
    c4 = DOF*pos4

    u4nodes = np.zeros(4*DOF, dtype=np.float64)
    u4nodes[0*DOF:1*DOF] = u[c1:c1+DOF]
    u4nodes[1*DOF:2*DOF] = u[c2:c2+DOF]
    u4nodes[2*DOF:3*DOF] = u[c3:c3+DOF]
    u4nodes[3*DOF:4*DOF] = u[c4:c4+DOF]

    nint = points.shape[0]

    for i in range(nint):
        xi = points[i]
        weight_xi = weights[i]
        for j in range(nint):
            eta = points[j]
            weight_eta = weights[j]
            weight = weight_xi*weight_eta
            N = A @ plate.Bm(xi, eta) @ u4nodes + B @ plate.Bb(xi, eta) @ u4nodes
            Nxx = N[0]
            Nyy = N[1]
            Nxy = N[2]
            Kg[2+c1, 2+c1] += weight*( 9*(eta - 1)**2*(xi - 1)**2*(lex*(eta + 1)*(xi - 1)*(xi + 2)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 1)*(eta + 2)*(xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(256*lex*ley) )
            Kg[2+c1, 3+c1] += weight*( 3*(eta - 1)**2*(xi - 1)**2*(3*lex*(eta + 1)*(xi - 1)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 1)*(eta + 2)*(3*xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(512*ley) )
            Kg[2+c1, 4+c1] += weight*( 3*(eta - 1)**2*(xi - 1)**2*(lex*(3*eta + 1)*(xi - 1)*(xi + 2)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + 3*ley*(eta - 1)*(eta + 1)*(xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(512*lex) )
            Kg[2+c1, 5+c1] += weight*( 3*(eta - 1)**2*(xi - 1)**2*(lex*(3*eta + 1)*(xi - 1)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 1)*(eta + 1)*(3*xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/1024 )
            Kg[2+c1, 2+c2] += weight*( -9*(eta - 1)**2*(xi - 1)*(xi + 1)*(lex*(eta + 1)*(xi - 2)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 1)*(eta + 2)*(xi - 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(256*lex*ley) )
            Kg[2+c1, 3+c2] += weight*( 3*(eta - 1)**2*(xi - 1)*(xi + 1)*(3*lex*(eta + 1)*(xi - 1)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 1)*(eta + 2)*(3*xi - 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(512*ley) )
            Kg[2+c1, 4+c2] += weight*( -3*(eta - 1)**2*(xi - 1)*(xi + 1)*(lex*(3*eta + 1)*(xi - 2)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + 3*ley*(eta - 1)*(eta + 1)*(xi - 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(512*lex) )
