            Kg[2+c1, 3+c3] += weight*( -3*(eta - 1)*(eta + 1)*(xi - 1)*(xi + 1)*(3*lex*(eta - 1)*(xi - 1)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 2)*(eta + 1)*(3*xi - 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(512*ley) )
            Kg[2+c1, 4+c3] += weight*( -3*(eta - 1)*(eta + 1)*(xi - 1)*(xi + 1)*(lex*(3*eta - 1)*(xi - 2)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + 3*ley*(eta - 1)*(eta + 1)*(xi - 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(512*lex) )
            Kg[2+c1, 5+c3] += weight*( 3*(eta - 1)*(eta + 1)*(xi - 1)*(xi + 1)*(lex*(3*eta - 1)*(xi - 1)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 1)*(eta + 1)*(3*xi - 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/1024 )
            Kg[2+c1, 2+c4] += weight*( -9*(eta - 1)*(eta + 1)*(xi - 1)**2*(lex*(eta - 1)*(xi - 1)*(xi + 2)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 2)*(eta + 1)*(xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(256*lex*ley) )
            Kg[2+c1, 3+c4] += weight*( -3*(eta - 1)*(eta + 1)*(xi - 1)**2*(3*lex*(eta - 1)*(xi - 1)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 2)*(eta + 1)*(3*xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(512*ley) )
            Kg[2+c1, 4+c4] += weight*( 3*(eta - 1)*(eta + 1)*(xi - 1)**2*(lex*(3*eta - 1)*(xi - 1)*(xi + 2)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + 3*ley*(eta - 1)*(eta + 1)*(xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/(512*lex) )
            Kg[2+c1, 5+c4] += weight*( 3*(eta - 1)*(eta + 1)*(xi - 1)**2*(lex*(3*eta - 1)*(xi - 1)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nyy*lex*(eta + 1)*(xi - 1)*(xi + 2)) + ley*(eta - 1)*(eta + 1)*(3*xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(xi + 1) + Nxy*lex*(eta + 1)*(xi - 1)*(xi + 2)))/1024 )
            Kg[3+c1, 2+c1] += weight*( 3*(eta - 1)**2*(xi - 1)**2*(lex*(eta + 1)*(xi - 1)*(xi + 2)*(Nxy*ley*(eta - 1)*(eta + 2)*(3*xi + 1) + 3*Nyy*lex*(eta + 1)*(xi - 1)*(xi + 1)) + ley*(eta - 1)*(eta + 2)*(xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(3*xi + 1) + 3*Nxy*lex*(eta + 1)*(xi - 1)*(xi + 1)))/(512*ley) )
            Kg[3+c1, 3+c1] += weight*( lex*(eta - 1)**2*(xi - 1)**2*(3*lex*(eta + 1)*(xi - 1)*(xi + 1)*(Nxy*ley*(eta - 1)*(eta + 2)*(3*xi + 1) + 3*Nyy*lex*(eta + 1)*(xi - 1)*(xi + 1)) + ley*(eta - 1)*(eta + 2)*(3*xi + 1)*(Nxx*ley*(eta - 1)*(eta + 2)*(3*xi + 1) + 3*Nxy*lex*(eta + 1)*(xi - 1)*(xi + 1)))/(1024*ley) )
